import "./App.css";
import Footer from "./Components/Footer";

import Navbar from "./Components/Navbar";
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Navbar />
        <div className="image">
          <img src="./img/lamp.png" className="lamp" />
          <img src="./img/light.png" className="light" />
        </div>
      </header>

      <Footer />
    </div>
  );
}

export default App;
